export default function Popup({name, handleDeleteTrue, handleDeleteFalse}) {
  return (
    <div>
        <p>You sure you wanna delete {name.title}?</p>
        <button onClick={handleDeleteFalse}>Cancel</button>
        <button onClick={handleDeleteTrue}>
            Confirm
        </button>
    </div>
  )
}
